import React, {useState} from 'react'
import Board from '../Elements/Board'
import $ from 'jquery'

interface IBoard {
  id: number,
  name: string,
  description: string
}

function Main (): JSX.Element {
  const [boards, setBoards] = useState<IBoard[] | []>([])

  return <div className={'boards-container'}>
    { boards.map() }
  </div>
}

export default Main
